import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Use Routes instead of Route directly
import Hero from './components/Hero/Hero';

import QRScanner from './components/QRScanner/QRScanner'; // Import QRScanner component

function App() {
  return (
    <Router>
      <div className="App">
        {/* Define routes using Routes and Route */}
        <Routes>
          <Route path="/" element={<Hero />} />

          <Route path="/qr-scanner" element={<QRScanner />} />  {/* QRScanner route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
